import React, { useEffect, useState } from 'react'

const Data = () => {

    const [data, setData] = useState([]);
    const [name, setName] = useState("");
    const [password, setPassword] = useState("");
    const [email, setEmail] = useState("");
    const [gender, setGender] = useState("");
    const [userId, setuserId] = useState(null);

    useEffect(() => {
        fetch("https://localhost:1111/list-todo")
            .then(response => {
                return response.json()
            })
            .then(data => {
                setData(data)
                setName(data[0].name)
                setEmail(data[0].email)
                setPassword(data[0].password)
                setGender(data[0].gender)
                setuserId(data[0].id)
            })
    }, []);

    function deleteUser(id) {
        fetch(`https://localhost:1111/delete-todo/${id}`, {
            method: "DELETE"
        }).then((response) => {
            response.json()
                .then((response) => {
                    console.log(response);
                })
        })
    }

    function seleteUser(id) {
        let item = data[id - 1];
        setName(item.name);
        setEmail(item.email);
        setPassword(item.password);
        setGender(item.gender);
        setuserId(item.id);
    }

    function updateUser() {
        let item = { name, email, password, gender }
        // console.log('item::: ', item);
        fetch(`https://localhost:1111/update-todo/${userId}`, {
            method: "PUT",
            headers: {
                'Accept': 'application/json',
                'Content-type': 'application/json',
            },
            body: JSON.stringify(item)
        }).then((response) => {
            response.json()
                .then((response) => {
                    console.log(response);
                })
        })
    }

    return (
        <>
            <table border="1">
                <tr>
                    <td>id</td>
                    <td>name</td>
                    <td>email</td>
                    <td>password</td>
                    <td>gender</td>
                </tr>
                {
                    data.map((item) =>
                        <tr>
                            <td>{ item.id }</td>
                            <td>{ item.name }</td>
                            <td>{ item.email }</td>
                            <td>{ item.password }</td>
                            <td>{ item.gender }</td>
                            <td><button onClick={ () => seleteUser(item.id) }>update</button></td>
                            <td><button onClick={ () => deleteUser(item.id) }>delete</button></td>
                        </tr>
                    )
                }
            </table>

            <div>
                <input type="text" value={ name } onChange={ (e) => { setName(e.target.value) } } /> <br />
                <input type="text" value={ email } onChange={ (e) => { setEmail(e.target.value) } } /> <br />
                <input type="text" value={ password } onChange={ (e) => { setPassword(e.target.value) } } /> <br />
                <input type="text" value={ gender } onChange={ (e) => { setGender(e.target.value) } } /> <br />
                <button onClick={ updateUser }>update user</button>
            </div>
        </>
    )
}

export default Data
